import { makeStyles } from "@material-ui/core";

export default makeStyles((theme) => ({
  grid: {
    height: "100vh",
    width: "100vw",
    display: "flex",
    flexDirection: "row",
    flexWrap: "wrap",
    background: "white",
  },
  sidebar: {
    height: "100vh",
    width: "15%",
    transition: "width .3s",
  },
  smallSidebar: {
    width: "5%",
    transition: "width .5s",
  },
  mainContent: {
    width: "85%",
    transition: "width .6s ease in",
    transitiontimingfunction: "linear",
    transitiondelay: "1s",
  },
  bigMainContent: {
    width: "95%",
    transition: "width .5s",
  },
}));
